"use client";

import { useState, useEffect } from "react";
import { Dialog, DialogPanel } from "@headlessui/react";
import Logo from "./assessts/Logo-1.png"; // Ensure the correct path

const navigation = [
  { name: "Menu", href: "#" },
  { name: "About Us", href: "#" },
  { name: "Location", href: "#" },
];

export default function Header() {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 50);
    };

    window.addEventListener("scroll", handleScroll);
    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  return (
    <div
      className={`fixed inset-x-0 top-0 z-50 transition-all duration-300 ${
        scrolled ? "bg-white shadow-lg" : "bg-transparent"
      }`}
    >
      <header className="flex items-center justify-between p-4 lg:p-6">
        <div className="flex items-center">
          <a href="#" className="flex items-center">
            <img
              alt="Curry Express Logo"
              src={Logo}
              className="h-10 w-auto"
              loading="lazy"
            />
          </a>
        </div>
        <nav className="hidden lg:flex lg:gap-x-8">
          {navigation.map((item) => (
            <a
              key={item.name}
              href={item.href}
              className={`text-lg font-semibold text-gray-900 transition duration-200 hover:text-blue-500`}
            >
              {item.name}
            </a>
          ))}
        </nav>
        <div className="hidden lg:flex">
          <input
            type="text"
            placeholder="Search..."
            className={`border border-gray-300 rounded-full px-4 py-2 transition duration-200 focus:outline-none ${
              scrolled ? "bg-white" : "bg-transparent text-gray-200"
            }`}
          />
        </div>
        <div className="flex lg:hidden">
          <button
            type="button"
            onClick={() => setMobileMenuOpen(true)}
            className={`text-gray-900 focus:outline-none`}
          >
            <span className="sr-only">Open main menu</span>
            <svg
              xmlns="http://www.w3.org/2000/svg"
              className="h-6 w-6"
              fill="none"
              viewBox="0 0 24 24"
              stroke="currentColor"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M4 6h16M4 12h16m-7 6h7"
              />
            </svg>
          </button>
        </div>
      </header>

      <Dialog
        open={mobileMenuOpen}
        onClose={() => setMobileMenuOpen(false)}
        className="lg:hidden"
      >
        <div className="fixed inset-0 z-50 bg-black opacity-75" />
        <DialogPanel className="fixed inset-0 z-50 bg-white p-6 flex flex-col items-center">
          <div className="flex items-center justify-between mb-4">
            <a href="#" className="flex items-center text-gray-900">
              <img
                alt="Curry Express Logo"
                src={Logo}
                className="h-10 w-auto"
                loading="lazy"
              />
            </a>
            <button
              type="button"
              onClick={() => setMobileMenuOpen(false)}
              className="text-gray-900 focus:outline-none"
            >
              <span className="sr-only">Close menu</span>
              <svg
                xmlns="http://www.w3.org/2000/svg"
                className="h-6 w-6"
                fill="none"
                viewBox="0 0 24 24"
                stroke="currentColor"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth={2}
                  d="M6 18L18 6M6 6l12 12"
                />
              </svg>
            </button>
          </div>
          <nav className="flex flex-col space-y-4">
            {navigation.map((item) => (
              <a
                key={item.name}
                href={item.href}
                className="text-lg font-medium text-gray-900 hover:bg-gray-200 rounded-full px-4 py-2 transition duration-200"
              >
                {item.name}
              </a>
            ))}
            <input
              type="text"
              placeholder="Search..."
              className="border border-gray-300 rounded-full px-4 py-2 mt-4"
            />
          </nav>
        </DialogPanel>
      </Dialog>
    </div>
  );
}
